L'église de la Visitation de la Bienheureuse-Vierge-Marie que l'on nomme aussi plus simplement l'église de la Visitation, est la seule église de style traditionnel québécois sur l'île de Montréal1. Construite en pierres des champs entre 1749 et 1751, elle est la plus ancienne église de Montréal encore debout2. La façade, modifiée entre 1850 et 1870, est en pierres de taille. Elle est située au 1847, boulevard Gouin Est, au Sault-au-Récollet dans l'arrondissement Ahuntsic-Cartierville, à Montréal.

Source : [[https://fr.wikipedia.org/wiki/%C3%89glise_de_la_Visitation_de_la_Bienheureuse-Vierge-Marie]]

{{https://upload.wikimedia.org/wikipedia/commons/thumb/0/01/Montreal_Visitation1_tango7174.jpg/280px-Montreal_Visitation1_tango7174.jpg}}

Le parc Belmont est un parc d'attractions ayant opéré de 1923 à 1983 dans Cartierville, un quartier du nord de Montréal, au Canada. Situé sur la rive de la rivière des Prairies, juste à côté du pont Lachapelle qui l'enjambe pour relier Montréal à Laval, ce lieu de divertissement fut un lieu-culte de Montréal. De nos jours, le parc Belmont peut également désigner un petit parc aménagé approximativement au même endroit.

Source : [[https://fr.wikipedia.org/wiki/Parc_Belmont_(Montr%C3%A9al)]]

{{https://img.banq.qc.ca/iiif/2/1CQoxg7s4U0VX2NWOd9tUg/full/800,/0/default.jpg}}

La maison du Meunier se trouve au bord de la rivière des Prairies, sur la rue du Pont qui mène au secteur de l’Île. La maison du Meunier est une bâtisse ancestrale qui témoigne de l’époque du site des moulins. Profitez de sa populaire terrasse donnant sur la rivière des Prairies et savourez un bon repas servi par le Festigoût café.

Source : [[https://montreal.ca/lieux/maison-du-meunier-du-parc-nature-de-lile-de-la-visitation]]

